import { useParams } from "react-router";

const QuotesDetails = () => {
  const params = useParams();
  return (
    <Fragment>
      <h1>New Quotes</h1>
      <p>{params.quotesId}</p>
      <Route paths={`/quotes/${params.quotesId}/comments`}>
        <Comments />
      </Route>
    </Fragment>
  );
};

export default QuotesDetails;
